import React from 'react';
import '../styles/Style.css';

function Input(props) {
  const Field = () => {
    <div>
      <div>
        <h2>{props.symbol}</h2>
      </div>
      <fieldset>
        <input name={props.name} type="text" placeholder={props.placeholder} />
      </fieldset>
    </div>;
  };
  return <Field />;
}

export default Input;
